import React from 'react';

const Attendants = (props) => {
    return (
        <div>
            I can attend to the tasks
            <ol style={{textAlign: 'left'}}>
                <li>Roger</li>
                <li>Henry</li>
                <li>Angel</li>
                <li>Willy</li>
                <li>Ronnie</li>
            </ol>
        </div>
    );
};

export default Attendants;
